(1000, '教学队伍介绍', 'jxdw', '<p>&nbsp; 课程建设小组共6人，结构合理，平均年龄37岁，硕士占60%，高级职称占60%，教学梯队以老带新，分工明确，包括题库建设负责教师，多媒体课件建设负责教师，网站建设负责教师，实验项目改革与实施指导教师，课题组成员相互协调有较好的合作基础，每个教师都具有实践教学的经验，80%教师有指导学生电子竞赛获奖的经历。&nbsp;<br />\r\n&nbsp; 全体教师具有良好的师德、责任心，具有较高的业务水平和严谨的治学态度，具有丰富的教学经验和能力。并在教学实践、教学改革和教学科研中不断的充实提高。主讲教师的课程在学生和院系的测评中均获得很好的评价。</p>\r\n', 10000, 1424934728, 1425117012, 1, 0, 1026, 0, 0, 100, '', '', '', ''),
(1001, '联系我们', 'contact', '<p><span style="font-size:20px;"><span style="text-align: -webkit-right; background-color: rgb(255, 255, 255);">QQ：</span><span style="background-color: rgb(255, 255, 255);">809860702</span></span></p>\r\n\r\n<p><span style="font-size:20px;"><span style="text-align: -webkit-right; background-color: rgb(255, 255, 255);">邮箱：</span><a href="mailto:gesuzhen@163.com" style="color: rgb(153, 51, 0); text-decoration: none; background-color: rgb(255, 255, 255);"><span style="color:#000000;">gesuzhen@163.com</span></a></span></p>\r\n\r\n<p><span style="font-size:20px;">电话：<span style="background-color: rgb(255, 255, 255);">0575-88348006</span></span></p>\r\n\r\n<p><span style="font-size:20px;">传真：<span style="background-color: rgb(255, 255, 255);">0575-88061806</span></span></p>\r\n\r\n<p><span style="font-size:20px;">短号：<span style="background-color: rgb(255, 255, 255);">666491</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n', 10000, 1425015401, 1425017007, 1, 0, 0, 0, 0, 100, '', '', '', '');
