(3182, 10006, '党建工作会议召开', '', '<p><span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">1月19日上午，学院召开党建工作会议，院领导章融、叶国灿等出席，各党总支、直属党支部负责人与会。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp; 会议通报了2014年度学院优秀基层党组织获得者名单，工程与技术系、外语系、机关党总支获得优秀基层党组织称号。会上，优秀基层组织代表，工程与技术系党总支负责人汇报了一年来的主要工作，该系在支部创新建设、思想政治教育、党建宣传工作等方面取得了显著成绩。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp; 叶国灿书记在会上发表讲话，回顾了一年来学院党建主要工作。叶书记指出，2014年度，学院党建工作以党的十八大、十八届三中全会以及习近平系列讲话精神为指引，在上级党委有关文件精神的要求和指导下，结合我院实际，党建各项事业不断攀上新台阶，营造了组织育人、学习育人、实践育人、服务育人的良好氛围，为学院提升内涵、优化发展提供了坚强保障。在思想政治教育、健全党员教育管理机制、强化组织工作、宣传与校园文化建设、纪检工作、推进共青团工作等方面取得了切实的成效。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp; 对于学院2015年的党建工作，叶书记指出，2015年学院党建工作要以中央会议精神及习近平系列讲话精神为指引，围绕学院中心工作，以打造学习型、服务型、创新型&ldquo;三型&rdquo;党组织为目标，为学院各项事业的发展提供坚实的政治和思想保障。2015年学院的党建工作主要包括进一步加强党建工作的顶层设计、加强干部队伍建设、规范党员发展工作、拓宽党员后续教育平台、加强党建思想引领、加强基层组织建设、做好宣传工作、强化党风廉政建设工作、加强群团组织建设等九个大项二十条工作内容。</span></p>\r\n', 0, 1425115034, 1425115034, '2015-02-28', 1425115034, 1429067885, 10000, 0, 1, 0, 0, '', 0, 100, 2, 0, '', '', ''),
(3183, 10006, '学院开展“真爱大行动”系列活动，完善全程资助育人体系', '', '<p><span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">学院高度重视家庭经济困难学生的学习和生活状况，近日开展了&ldquo;真爱大行动&rdquo;系列活动，切实帮助他们缓解心理压力，解决生活困难，促进顺利就业，为其成人成长成才营造和谐的环境。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp;&nbsp;</span><strong style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">真爱基金捐赠：</strong><span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">我院&ldquo;真爱基金&rdquo;爱心传递活动已连续开展十年。十年来，学院不断优化活动的管理模式，探讨活动的长效机制，形成良性的运作方式，推进了活动的可持续发展。今年，活动同样得到了广大师生，尤其是奖学金获得者的大力支持，同学们纷纷慷慨解囊，收到捐赠款项47291元，学院将全部用于资助突发困难学生的临时补助工作。这充分展示了我院学生&ldquo;感恩与责任，真诚与热爱&rdquo;的良好精神风貌，发扬了学院的真诚奉献精神，互帮互助的优良传统。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp;&nbsp;</span><strong style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">真爱送温暖：</strong><span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">针对近期寒意来袭，学工部积极牵头布置，各系召开了御寒慰问座谈会或系主要领导亲自走访寝室等形式，进一步了解该系特困新生的学习和生活情况，并代表学院送上慰问物品。同时勉励他们自立自强，不断提高自身的综合素质，叮嘱他们注重身体，刻苦学习，争取在期末取得优异的成绩。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp;&nbsp;</span><strong style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">真爱助力考研：</strong><span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">辅导员、班主任老师召开考研宣讲会、积极走进寝室，了解学生的备考情况，并结合自身考研方面的经验，鼓励他们坚定决心，顽强拼搏，坚持到底。同时希望他们注重劳逸结合，以最佳状态参加考试，代表学院送上了牛奶、饼干等慰问物品。在考研前夕，学院也积极创造条件，对考研学生进行了交通补助，送上学院的美好祝福。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp;&nbsp;</span><strong style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">真爱为就业助跑：</strong><span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">为认真贯彻落实学院关于招生就业工作会议精神，达到分类资助目的，对于正在求职的困难毕业生，学院安排了专项资金，一次性发放就业补助16600元，后期将进一步跟进困难毕业生就业全过程，根据实际情况对他们进行有关补助。同时，积极了解他们的就业思想和状况，提供就业信息，拓宽就业渠道。</span><br style="padding: 0px; margin: 0px; color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);" />\r\n<span style="color: rgb(85, 85, 85); font-size: 17px; letter-spacing: 3px; line-height: 25px; background-color: rgb(245, 251, 255);">&nbsp;&nbsp;&nbsp; 受助学生纷纷表示，学院提供的帮助，让他们切实感受到了关爱和温暖。今后一定不辜负学院的期望、老师们的嘱托，认认真真学习，踏踏实实做人。学工部相关负责人表示，学院一直以来坚持以学生为本，对困难生的工作尤为关心。此次活动为&ldquo;真爱大行动&rdquo;部分内容，下学期将更加深入开展系列活动，积极探索资助文化育人新机制，完善全程资助育人新体系。</span></p>\r\n', 0, 1425115076, 1425115076, '2015-02-28', 1425115076, 1425126135, 10000, 0, 1, 0, 0, '', 0, 100, 4, 0, '', '', ''),
