(3186, 10016, 'donghhu', '', '<p>动画 啥的发生的<span style="font-family: Arial; font-size: 13px; background-color: rgb(255, 255, 255);">青葱的高中学子，婀娜的红楼金钗，魁梧的三国英雄在舞台上粉墨登场，一抬袖，一转身，风流无限。这是我系于11日晚6:30在经管楼南207举行的情景剧大赛决赛现场，本次大赛由我系团总支学生会组织部和信息中心共同承办。比赛邀请了人文科学系池若飞、孙靓和郑丹洁老师，以及学生代表魏怡楠等担任评委。 此次活动为经典情景剧决赛和&ldquo;跃动&bull;征程&rdquo;系列活动闭幕式。 第一部分为开场，由&ldquo;致亲爱的你&rdquo;演讲朗诵大赛冠军林青平献上深情朗诵。 第二部分是经典情景剧大赛决赛第一轮:经典重现。6组选手依次进行表演，内容有电影片段、小说节选以及童话故事等。&ldquo;ESE童话屋&rdquo;组合表演了经典童话《白雪公主和七个小矮人》,全英文对话让现场观众惊叹不已，选手激情的表演更是赢得现场阵阵掌声，尤其是恶毒的皇后，选手丰富的面部表情，富有感染力的语调使这个角色栩栩如生。而后&ldquo;木石勤深&rdquo;组合为我们带来了东方经典《红楼梦》片段。将多愁善感的林黛玉，直爽泼辣的王熙凤扮演得入木三分。黛玉眉眼含情，楚楚动人。最后上场的&ldquo;三雄演义&rdquo;组合表演了《三国演义》中&ldquo;桃园三结义&rdquo;这一经典情节。选手们精湛的演技，精美的服装和搞笑的扮相引得观众笑声不断。腥风血雨的三国里，天苍苍，水茫茫，喊杀声里，将军百战死，壮士十年归，桃园结义的豪情显得弥足珍贵。第一轮过后，&ldquo;三雄演义&rdquo;凭借刘备、关羽和张飞的兄弟义气获得本轮最高分，&ldquo;石木勤深&rdquo;暂居第二。 视觉盛宴告一段落，嘉宾林飞扬和强驰同学演唱的歌曲《一眼瞬间》给观众带来了听觉的享受。 美妙的歌声过后，进入今晚的第三部分也是情景剧决赛的第二轮:前因后果。本轮6组选手抽签，分为3组进行两两PK。比赛要求选手根据节目组给出的故事开头和结尾，对中间部分进行合理想象和表演。由&ldquo;We are winners&rdquo;和&ldquo;三雄演义&rdquo;为观众带来的《大话西游》PK，深情而又幽默的至尊宝和美丽的紫霞仙子，选手扮演得惟妙惟肖，那段&ldquo;爱你一万年&rdquo;的誓言，让人热泪盈眶。 两轮结束后，本次大赛的最终成绩也出炉了。一等奖由&ldquo;三雄演义&rdquo;获得，二等奖被&ldquo;石木勤深&rdquo;摘取,三等奖得主则是&ldquo;ESE童话屋&rdquo;。到此&ldquo;剧星闪耀&rdquo;经典情景剧大赛决赛完结。 之后主持人带领观众回顾了本学期的团学历程。从&ldquo;艺懿生辉&rdquo;新生才艺大赛开始到今天经典情景剧大赛结束，这短短3个月人文团学绽放了一次又一次的精彩。回顾过去，展望未来；韶光锦年，顾昔寄新。 最后，由池若飞、郑丹洁和孙靓老师分别为一二三等奖获得者颁发奖杯和礼品。主持</span></p>\r\n', 0, 1425115571, 1425115571, '2015-02-28', 1425115571, 1430168834, 10000, 0, 1, 0, 0, '', 0, 100, 4, 0, '', '', ''),
